📌 Пройти УЗИ в городе Барановичи недорого и без очередей! 📌
⠀
👉 Что для этого нужно?
Просто позвонить и записаться по номеру +375 (44) 774-08-16
или приехать лично по адресу ул. Брестская, 133 (внебюджетный отдел).
⠀
👉 И это ещё не всё!
В Барановичской городской больнице введён в эксплуатацию новый современный аппарат ультразвуковой диагностики. Используя современное оборудование, наши опытные врачи гарантируют высокое качество диагностики.
⠀
👉 Виды УЗИ, доступные в Барановичской городской больнице:
- УЗИ вен, артерий нижних конечностей;
- УЗИ сердца;
- УЗИ органов брюшной полости и почек;
- УЗИ щитовидной железы с лимфатическими поверхностными узлами;
- УЗИ мочевого пузыря;
- УЗИ мягких тканей;
- УЗИ плевральной полости;
- УЗИ БЦА;
и другие ультразвуковые исследования.
⠀
📞 Звоните! Наши цены вас приятно удивят!
+375 (44) 774-08-16
8 (0163) 63-83-90
⠀
🏥 Барановичи, ул. Брестская, 133
