👩‍⚕️👨‍⚕️Консультации эндокринолога и нефролога без очередей в городе Барановичи. ⠀
👉Как попасть к врачу на консультацию?
Позвонить и записаться по номеру 📲 +375 (44) 774-08-16 или ☎️ +375 (163) 63-83-90, получить консультацию опытного врача в Барановичской городской больнице 🏥 после оплаты услуги.
⠀
👉Сколько стоит консультация врача для граждан Республики Беларусь?
Консультация врача первой категории – 7,00 руб., высшей категории – 7,20 руб.👍
⠀
👉У вас опытные врачи?
Безусловно, все консультирующие врачи Барановичской городской больницы имеют большой опыт клинической работы.👍
⠀
👉При каких симптомах стоит задуматься о консультации врача-эндокринолога:
- сонливость, вялость и депрессия;
- сухость кожных покровов;
- неожиданная прибавка или потеря веса;
- нарушения менструального цикла у женщин;
- учащенное мочеиспускание, сильная жажда;
- непереносимость жары;
- учащенное сердцебиение и повышение артериального давления;
- снижение либидо;
- бесплодие;
- снижение зрения, головная боль;
- повышенная ломкость костей;
- изменения черт лица и других симптомах.
⠀
👉При каких симптомах стоит задуматься о консультации врача-нефролога:
- боль или чувствительность в поясничной области;
- изменения объема мочи;
- повышение артериального давления;
- изменения лабораторных показателей (повышение уровня креатинина, мочевины, калия, натрия крови; наличие эритроцитов, лейкоцитов, белка в моче);
- отеки;
- общая слабость, повышение температуры тела;
- желтушность или бледность кожных покровов и других симптомах.
⠀
👌Звоните! Мы с удовольствием ответим на все ваши вопросы.👈
📞+375 (44) 774-08-16
📞+375 (163) 63-83-90
⠀
Барановичи, ул. Брестская, 133 (внебюджетный отдел)
пн-пт 8:00 – 16:30 (обед 13:00 - 13:30)
сб-вс 9:00 – 13:00 (без обеда)
⠀
